import { createStore } from 'redux'

const defaultState = {
	searchString: '',
	searchResults: [],
}

const store = createStore((state=defaultState,action='')=>{
    console.log('The reducer has just recived the following:','state',state,'action',action)
    return {state}
});

export default store;
